import React, { Fragment } from 'react';
import { View, Image } from 'react-native';

// Components
import CustomText from './CustomText';

function Offers() {
	return (
		<Fragment>
			<CustomText customStyle={{ textAlign: 'right', marginRight: 25, fontSize: 20, marginTop: 15 }}>
				پیشنهاد ویژه
			</CustomText>

			<Image source={require('../assets/three.png')} style={{ width: 120, height: 200 }} />
		</Fragment>
	);
}

export default Offers;
